import React from 'react';

const IsometricBlock = props => {

    console.log((props.number+1)*10)
    return (
        <li className="iso-block">
            {[...Array(props.number)].map(number=>{
               return  <span></span>
            })}
            <span><props.icon style={{color: props.color , transform:(`translate${(props.number+1)*10}px, -${(props.number+1)*10}px`)}} size={30}/></span>
        </li>
    );
};

export default IsometricBlock;
